Now that we have the system compiling, lets write a small test program to make sure we can actually crash the program when a stack smash is detected. The program should overwrite a buffer on the stack: #include <cstdio> static void smasher(char* string)
{
#pragma GCC diagnostic push
#pragma GCC diagnostic ignored "-Warray-bounds" for (int i = 0; i < 256; i++) { string[i] = 'A'; }
#pragma GCC diagnostic pop
} static void stack_to_smash()
{ char string[8] = {}; smasher(string);
} int main()
{ puts("[+] Starting the stack smash..."); stack_to_smash(); puts("[+] Stack smash wasn't detected!"); return 0;
} Lets see what happens if we compile this, and run it in Serenity. courage ~ $ ./user/Tests/LibC/stack-smash
[+] Starting the stack smash ...
[+] Stack smash wasn't detected! Hrm... that's not good, what's going on? After looking at the disassembly it's obvious, the stack_to_smash() call is being completely in-lined and optimized out. $ objdump -M intel --disassemble=main Userland/Tests/LibC/stack-smash
Userland/Tests/LibC/stack-smash: file format elf32-i386
00000510 <main>: 510: 8d 4c 24 04 lea ecx,[esp+0x4] 514: 83 e4 f0 and esp,0xfffffff0 517: ff 71 fc push DWORD PTR [ecx-0x4] 51a: 55 push ebp 51b: 89 e5 mov ebp,esp 51d: 53 push ebx 51e: e8 82 00 00 00 call 5a5 <__x86.get_pc_thunk.bx> 523: 81 c3 e5 13 00 00 add ebx,0x13e5 529: 51 push ecx 52a: 83 ec 0c sub esp,0xc 52d: 8d 83 a1 ee ff ff lea eax,[ebx-0x115f] 533: 50 push eax 534: e8 97 ff ff ff call 4d0 <puts@plt> 539: 8d 83 c1 ee ff ff lea eax,[ebx-0x113f] 53f: 89 04 24 mov DWORD PTR [esp],eax 542: e8 89 ff ff ff call 4d0 <puts@plt> 547: 8d 65 f8 lea esp,[ebp-0x8] 54a: 31 c0 xor eax,eax 54c: 59 pop ecx 54d: 5b pop ebx 54e: 5d pop ebp 54f: 8d 61 fc lea esp,[ecx-0x4] 552: c3 ret We can add __attribute__((noinline)) to our function definitions to instruct the compiler to not inline calls to our test functions: #include <cstdio> // Note: Needs to be 'noline' so stack canary isn't optimized out.
static void __attribute__((noinline)) smasher(char* string)
{
#pragma GCC diagnostic push
#pragma GCC diagnostic ignored "-Warray-bounds" for (int i = 0; i < 256; i++) { string[i] = 'A'; }
#pragma GCC diagnostic pop
} // Note: Needs to be 'noline' so stack canary isn't optimized out.
static void __attribute__((noinline)) stack_to_smash()
{ char string[8] = {}; smasher(string);
} int main()
{ puts("[+] Starting the stack smash..."); stack_to_smash(); puts("[+] Stack smash wasn't detected!"); return 0;
} After re-compiling we can see the compiler instrumentation in the binary now, note the injected calls to __stack_chk_fail_local in the disassembly of _ZL14stack_to_smashv: $ objdump -M intel --disassemble=main Userland/Tests/LibC/stack-smash
Userland/Tests/LibC/stack-smash: file format elf32-i386
00000690 <main>: 690: 8d 4c 24 04 lea ecx,[esp+0x4] 694: 83 e4 f0 and esp,0xfffffff0 697: ff 71 fc push DWORD PTR [ecx-0x4] 69a: 55 push ebp 69b: 89 e5 mov ebp,esp 69d: 53 push ebx 69e: e8 87 00 00 00 call 72a <__x86.get_pc_thunk.bx> 6a3: 81 c3 29 15 00 00 add ebx,0x1529 6a9: 51 push ecx 6aa: 83 ec 0c sub esp,0xc 6ad: 8d 83 1d ee ff ff lea eax,[ebx-0x11e3] 6b3: 50 push eax 6b4: e8 67 ff ff ff call 620 <puts@plt> 6b9: e8 1c 02 00 00 call 8da <_ZL14stack_to_smashv> 6be: 8d 83 3d ee ff ff lea eax,[ebx-0x11c3] 6c4: 89 04 24 mov DWORD PTR [esp],eax 6c7: e8 54 ff ff ff call 620 <puts@plt> 6cc: 8d 65 f8 lea esp,[ebp-0x8] 6cf: 31 c0 xor eax,eax 6d1: 59 pop ecx 6d2: 5b pop ebx 6d3: 5d pop ebp 6d4: 8d 61 fc lea esp,[ecx-0x4] 6d7: c3 ret 000008c6 <_ZL7smasherPc>: 8c6: 55 push ebp 8c7: 89 c2 mov edx,eax 8c9: b9 00 01 00 00 mov ecx,0x100 8ce: b0 41 mov al,0x41 8d0: 89 e5 mov ebp,esp 8d2: 57 push edi 8d3: 89 d7 mov edi,edx 8d5: f3 aa rep stos BYTE PTR es:[edi],al 8d7: 5f pop edi 8d8: 5d pop ebp 8d9: c3 ret 000008da <_ZL14stack_to_smashv>: 8da: e8 41 00 00 00 call 920 <__x86.get_pc_thunk.ax> 8df: 05 ed 12 00 00 add eax,0x12ed 8e4: 55 push ebp 8e5: 89 e5 mov ebp,esp 8e7: 53 push ebx 8e8: 83 ec 14 sub esp,0x14 8eb: 8d 98 28 00 00 00 lea ebx,[eax+0x28] 8f1: c7 45 ec 00 00 00 00 mov DWORD PTR [ebp-0x14],0x0 8f8: c7 45 f0 00 00 00 00 mov DWORD PTR [ebp-0x10],0x0 8ff: 8b 03 mov eax,DWORD PTR [ebx] 901: 89 45 f4 mov DWORD PTR [ebp-0xc],eax 904: 31 c0 xor eax,eax 906: 8d 45 ec lea eax,[ebp-0x14] 909: e8 b8 ff ff ff call 8c6 <_ZL7smasherPc> 90e: 8b 45 f4 mov eax,DWORD PTR [ebp-0xc] 911: 2b 03 sub eax,DWORD PTR [ebx] 913: 74 05 je 91a <_ZL14stack_to_smashv+0x40> 915: e8 5a 00 00 00 call 974 <__stack_chk_fail_local> 91a: 83 c4 14 add esp,0x14 91d: 5b pop ebx 91e: 5d pop ebp 91f: c3 ret With these changes we can see the system catches the corruption as expected: courage ~ $ ./user/Tests/LibC/stack-smash
[+] Starting the stack smash ...
Error: Stack protector failure, stack smashing detected!
Shell: Job 1 (/usr/Tests/LibC/stack-smash) Aborted
